import './App.css';
import { useEffect, useState } from 'react';
import Navbar from './nav/Navbar';
import Header from './nav/Header';
import Footer from './nav/Footer';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './components/Register';
import FuelQuoteForm from './components/FuelQuoteForm';
import FuelQuoteHistory from './components/FuelQuoteHistory';
import CustomerProfile from './components/customer_profile';
import { BrowserRouter as Router, Routes, Route} from "react-router-dom";

function App() {
  const [loggedIn, setLoggedIn] = useState(false)
  const [userName, setuserName] = useState('')

  return (
    <div className="App">
      <Router>
      <Header />
        <Navbar />
        <Routes>
          <Route exact path="/" element={<HomePage userName={userName} loggedIn={loggedIn} setLoggedIn={setLoggedIn}/>} />
          <Route exact path="/login" element={<Login setLoggedIn={setLoggedIn} setuserName={setuserName} />} />
          <Route exact path="/register" element={<Register />} />
          <Route exact path="/fuel-quote-form" element={<FuelQuoteForm />} />
          <Route exact path="/customer-profile" element={<CustomerProfile />} />
          <Route path="/fuel-quote-history" element={<FuelQuoteHistory />} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
